@AsYouNotWish @TarekFatah I today pledge never to fly any Malaysian airlines , travel to Malaysia or eat any dish beginning with Nasi 😠

Every indian should boycott anything Malaysian ! 

They can keep Zakir Naik for all I care !

@manakgupta Tell that to Media who cried buckets whn many wanted to boycott this match (aftr Pulwama Attacks).
Tell that to Brands who run Contests/Discounts &amp; what not esp for this day.
Tell that to Crowds. England match have empty seats. Yday booking requests were 4 times more thn capacity

